  false,\n\t\"url\": null,\n\t\"notes\": \"This surficial-geologic map shows the distribution
  of unconsolidated deposits and undifferentiated bedrock in the Faith Creek area
  in the Circle A-4, A-5, B-4, and B-5 quadrangles. This map was prepared principally
  by the interpretation of 1:63,360-scale, false-color, infrared aerial photographs
  taken in 1979 and 1981 and is locally verified by ground observations during field
